import React from 'react';
import styles from './Input.module.css';

const Input = ({ placeholder, type, name,children, text}) => {
    return(
      <form>
          <label for={text}>{children}</label>
          <input
          id={text}
          placeholder={placeholder} 
          type={type} 
          name={name}
          className={styles.input}
          />
      </form>
    ) 
  };
  
  export default Input;
